import React from 'react';
import {Link} from "react-router-dom";
const Programmer = () => {
    return (
        <>
            <SectionHeader
            title='Progra' 
            />

            <Link to={"/programmer/editor"} className="">
                Programátorské portfolio
            </Link>
        </>
    );
}

export default Programmer;
